import { useMemo } from "react";
import "./FrameComponent.css";

const FrameComponent = ({ propDisplay }) => {
  const b2Style = useMemo(() => {
    return {
      display: propDisplay,
    };
  }, [propDisplay]);

  return (
    <div className="info-frame">
      <div className="info22">
        <div className="name-label">
          <div className="wrapper50">
            <b className="b201" style={b2Style}>
              진승원
            </b>
          </div>
          <div className="div212">웹공학트랙</div>
        </div>
        <div className="progress-bar-track">
          <img
            className="personicon9"
            loading="lazy"
            alt=""
            src="/personicon.svg"
          />
        </div>
      </div>
    </div>
  );
};

export default FrameComponent;
